import React, { Fragment } from "react";
import { NavLink } from "react-router-dom";

import classes from "./nav.module.css";

const Navigation = () => {
  return (
    <Fragment>
      <nav className={classes.list_nav}>
        <NavLink className={classes.list_button}>List</NavLink>
      </nav>

      <nav className={classes.form_nav}>
        <NavLink className={classes.form_button}>Form</NavLink>
      </nav>
    </Fragment>
  );
};

export default Navigation;
